drop database if exists bdmolino;
create database bdmolino;
use bdmolino;

-- Tabla productos
drop table if exists productos;
CREATE TABLE productos (
  id_producto int,
  nombre_prod varchar(100) NOT NULL,
  detalles_prod varchar(250) NOT NULL,
  precio_prod int not null,
  imagen_prod mediumblob NOT NULL,
  id_cat int
);

-- Tabla categorias
drop table if exists categorias;
CREATE TABLE categorias (
  id_cat int,
  nombre_cat varchar(100) NOT NULL
);

-- Tabla usuarios
drop table if exists usuarios;
CREATE TABLE usuarios (
  id_user int,
  usuario varchar(100) NOT NULL,
  pwd varchar(100) NOT NULL
);

-- --------------- DECLARACIONES ------------------------------
ALTER TABLE productos
  ADD PRIMARY KEY (id_producto);
  
ALTER TABLE categorias
  ADD PRIMARY KEY (id_cat);
  
ALTER TABLE usuarios
  ADD PRIMARY KEY (id_user);
  
select * from usuarios;

select * from productos;
  
insert into usuarios (usuario, pwd)  values ('admin', '12345');
-- -------------- AUTO INCREMENTABLES------------------
ALTER TABLE productos
  MODIFY id_producto int NOT NULL AUTO_INCREMENT;
  
ALTER TABLE categorias
  MODIFY id_cat int NOT NULL AUTO_INCREMENT;
  
ALTER TABLE usuarios
  MODIFY id_user int NOT NULL AUTO_INCREMENT;

-- ---------------- foraneas ------------------------------

ALTER TABLE productos 
ADD FOREIGN KEY(id_cat) REFERENCES categorias(id_cat);
select * from productos;

-- PROCEDIMIENTOS 
-- Insertar productos

drop procedure if exists insertar_productos;
delimiter //
create procedure insertar_productos
(in
	nom_prod varchar(100) ,
	det_prod varchar(250) ,
	prec_prod int ,
	img_prod mediumblob,
    id_cat int
    
)
begin
insert productos (nombre_prod,detalles_prod,precio_prod,imagen_prod,id_cat)
 values (nom_prod,det_prod,prec_prod,img_prod,id_cat);
end //
delimiter ;

-- Insertar categorias

drop procedure if exists insertar_categorias;
delimiter //
create procedure insertar_categorias
(in
    nom_cat varchar(100) 
)
begin
insert categorias (nombre_cat) values (nom_cat);
end //
delimiter ;

