-- Actualizar productos

drop procedure if exists actualizar_productos;
delimiter //
create procedure actualizar_productos
( 	id_prod int,
	nom_prod varchar(100) ,
	det_prod varchar(250) ,
	prec_prod int ,
	img_prod mediumblob,
    id_cat int
)
begin
UPDATE productos set nombre_prod= nom_prod,detalles_prod = det_prod,precio_prod =prec_prod, imagen_prod = img_prod, id_cat = id_cat
 WHERE id_producto  = id_prod;
end //
delimiter ;


-- Actualizar categorias

drop procedure if exists actualizar_categorias;
delimiter //
create procedure actualizar_categorias
( 	id_cat  int,
	 nom_cat varchar(100) 
)
begin
UPDATE categorias set nombre_cat = nom_cat WHERE id_cat  = id_cat;
end //
delimiter ;


-- Actualizar usuarios

drop procedure if exists actualizar_usuarios;
delimiter //
create procedure actualizar_usuarios
( 	id_usu int,
	usu varchar(100) ,
	pwd varchar(100) 
)
begin
UPDATE usuarios set usuario = usu,pwd = pwd WHERE id_user = id_usu;
end //
delimiter ;

-- Eliminar productos

drop procedure if exists eliminar_productos;
delimiter //
create procedure eliminar_productos(
in id_prod int
)
begin 
DELETE from productos where id_producto  = id_prod ;
end //
delimiter ;

-- Eliminar categorias

drop procedure if exists eliminar_categorias;
delimiter //
create procedure eliminar_categorias(
in id_cat int
)
begin 
DELETE from categorias where id_cat = id_cat  ;
end //
delimiter ;

-- Eliminar usuarios

drop procedure if exists eliminar_usuario;
delimiter //
create procedure eliminar_usuario(
in id_usu int
)
begin 
DELETE from usuarios where id_user = id_usu  ;
end //
delimiter ;


